"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/pHCBu-Gz1t_g735gTDy1tw/l.jpg",
"rating":"4.0",
"reviewcomment":"People seem to love or hate Cotton. It&#39;s very low key and closes early due to the building being owned by UNH - 10pm closing as to not encourage their students to go drink there (however commercial st campus doesn&#39;t have housing.....so it seems like an odd stance)<br><br>They have a kick ass martini and by kick ass I mean it literally knocks you on your ass, and they have a two martini limit. Which actually means they won&#39;t serve you ANY DRINK after two martinis. I hate places with this rule and I also hate when the bartender doesn&#39;t tell you that when you order your 2nd martini....instead they say &#34;Sorry, it&#39;s on the menu&#34; when you go to order a third. Most people who drink martinis on a regular basis don&#39;t read the fine print on a drink menu...<br><br>Their food is pretty good, awesome crab cake, good calamari, good lobster ravioli....it&#39;s not a 5 star place, but a great upscale casual spot if you want something different.",
