"reviewcomment":"It&#39;s been years since I&#39;ve had Brazlian BBQ and wow, I don&#39;t remember it being this good (granted the other 2-3 times were at different restaurants). Â This is my favorite place now. Â We ate there on a Sunday evening around 5pm, the weather was terrible outside which might have been why it was relatively dead inside. Â The pre-dinner foods section was pretty good. Â We liked the grape leaves a lot. Â I also tried some of the seafood salad. Â <br><br>When the meats started coming out, we were ready. Â My favorites by far? Â The salmon, top sirloin, and beef ribs, in that order. Â The salmon was so soft that it just melted in your mouth. Â It was served with a very tasty sauce that taste sort of like Hollandaise. The top sirloin was a surprising second. Â The person that brought it out told us they only prepare it with a salt rub and I find that hard to believe because it was so tasty. Â It must have just been a perfectly cooked steak, very dark red in the middle which is how I love my steak. Â The beef ribs were very good too. Â I only helped myself to one serving though but I probably should have had more.<br><br>We also tried the lamb, prime rib but I didn&#39;t have any of the pork loin. Â Everything was really fantastic and if I&#39;m ever up in the Manchester area again, I would consider going back. Â You just have to be in that kind of mood with the right appetite to handle that much beef though!",
