"rating":"4.0",
"reviewcomment":"Just simply one of the best restaurants in a 30 miles radius. <br><br>I have HIGH standards for sushi. I&#39;ve had a lot of mediocre sushi from restaurants that are priced comparatively or even more expensive, and I&#39;ve always been disappointed because it&#39;s not as good as Chen&#39;s.<br><br>This is the kind that gives you a straight up tastegasm. Every single bite just makes me roll my eyes back in disbelief. You can taste each individual flavor coming together on your taste buds in the perfect combination of savory, sweet, and spicy depending on what roll you ordered. This is like NH&#39;s Mona Lisa of sushi. You can spend up to 15 dollars on their speciality rolls or about 4 on an avocado/cucumber roll and they will both be prepared to perfection. Ingredients are unfathomably fresh and the presentation is top notch. It&#39;s so beautiful it&#39;s ALMOST hard to eat. And that&#39;s just he sushi!<br><br>Chen&#39;s menu is DEEP! In addition to sushi they have an epic menu filled with delicious Chinese, Japanese, and Thai dishes. Some familiar and some unique. The ginger sauce that is served with the scallion pancake will make you question why you&#39;ve gone so long without tasting something so amazing.<br><br>This is my favorite restaurant in the area. Parking is limited but you can generally always get a table with little to no wait. Service is awesome to boot! Truly a 5 star establishment.",
