"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/JhEpNKqO9R5MRtHb4m3cGA/l.jpg",
"rating":"3.5",
"reviewcomment":"Murphy&#39;s Diner has become a new favorite of my group of friends. My boyfriend got a coupon for here so we went and were incredibly impressed, and spread the word which quickly was verified by everyone who tried it. We are here almost weekly now, every Saturday morning. I have had a few items, deep fried French Toast (good but not all that different from regular French Toast), Captain Crunch French Toast (my favorite, and pretty much everyone who has tried it&#39;s favorite) and the Banana&#39;s Foster Waffle (they put like 4 cooked tiny banana slices on a waffle, the waffle was so tasty but the small amount of bananas and lack of any special &#34;sauce&#34; was a bit stupid for a &#34;Special&#34; waffle). The breakfast sausage is a real sausage, not the tiny ones you expect. I personally enjoy the typical breakfast sausage and cannot stomach real sausage for breakfast but if you like that you will LOVE their sausage like my boyfriend does. Their homefries are pretty good, not seasoned so they are a bit bland but I enjoyed them. They use high quality eggs which I enjoyed, the fried eggs I got were very tasty. Overall I recommend Murphy&#39;s Diner, if you go do yourself a favor too and get the Maple Bacon Milkshake, it is AMAZEBALLS<br><br>P.S. The parking SUCKS. If it is busy you will not find a spot in the lot, just a heads up. If you go with a group, car pool.",
