"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/HZm0Znm8gvvtyEPk0yCeSQ/l.jpg",
"rating":"3.0",
"reviewcomment":"We took my mother out to dinner here for her birthday. This is where she wanted to go. It started off really rough. We had 11 of us in our party. When we arrived we were told that they had just seated a party of 12 so they had no room for us. They asked why we didn&#39;t call ahead, which was very strange because when we did call ahead we were told they don&#39;t take reservations. The host told us it would be at least an hour wait. We decided to wait. After about 10 minutes of waiting a table that could seat us all just happened to open up. <br> Â  After sitting down our waitress Kristine came over with bread she took our drink order. Came out with all our drinks knew which one of us got what drink. At that point we ordered some apps. All total we ordered 7 apps lobster shrimp dip, western cheese fries, fire cracker chicken wraps, grilled white cheddar stuffed mushrooms, house made chips and dip, wild west shrimp and one other I can&#39;t remember. The apps were all very good I was a little disappointed with the western cheese fries the menu said chili was suppose to be on them. I felt the chilli was lacking. Other then that everything was very good. <br> Â  Â Our food was very good everyone got steak and all our steaks were perfectly cooked they all came out together. Again our waitress Kristine knew exactly where everything went. Kristine stayed on top of all our refills we didn&#39;t need to ask they always just showed up at the perfect time. <br> Â Overall our experience was very good it started rough but ended very well no one in our party was disappointed with Â anything and we were all very very impressed with Kristine our waitress.<br> Â I would recommend the longhorn in Manchester to anyone that wants a good meal at a good price if you want great service request Kristine as your server.",
