"reviewcomment":"C&#39;mon complaining people! What&#39;s wrong with all of you!!? Where&#39;s the love?<br><br>[the bad reviews are actually out of date now]<br><br>A Bit of Perspective<br><br>Ok I&#39;ve been to probably a dozen Chipotle&#39;s in across CA, NV and now NH?? Wow, that is amazing in itself. And this one is now [in 2014] EXACTLY like the rest. In all, I&#39;ve had probably 30-40 visits total between all of the ones I&#39;ve been to. This one in Manchie kicks a$$. I&#39;ve been to it twice since I&#39;ve been visiting in town [both in 2014]. And both times, it was exactly what was expected, amazing.<br><br>Having said all that, I read thru some of the bad reviews below and suggest that when any chain restaurant like this is just opened [and on the opposite side of the country from where home is] they&#39;re far away from &#34;corporate&#34; and more errors are made and not corrected very quickly. My personal opinion is that they got a really bad rap for a pretty rough start. What I experienced was nothing like what was written below...<br><br>Seeing as most of those reviews are 1-2 years old now, new managers, new staff, they clearly have it all sorted out now and are running smoothly. Yes the ppl are really nice, and yes the managers are too. <br><br>But the food is great! And you can never beat the price. $<br>: ]...<br><br>[drool]",
