"rating":"3.5",
"reviewcomment":"Two my colleagues and I ventured to Tinker&#39;s on our last night on business in Manchester. We noted to the cashier at the order counter that we were first-timers and she gave us menus, encouraged us to grab a booth and order when ready. One of my colleagues and I shared the twin lobsters (one each--- though we only got one bib) and split an order of haddock. Both were delicious. I had a baked potato which was cooked perfectly. The coleslaw was not to my liking (but I generally am not a fan of any coleslaw made with mayo so this was not Tinker&#39;s fault). The decor is very casual but the service is not -- our food was delivered very quickly by a very friendly server. The prices are very reasonable and we all agreed that we had a tasty dinner here. <br><br>My only suggestion to Tinker&#39;s is to use a wider cup for the butter as it was hard to dip in the lobster without it overflowing the cup. <br><br>Even better, I got a senior&#39;s discount on the lobster!",
