"rating":"3.5",
"reviewcomment":"Probably the best dining experience I&#39;ve ever had. <br><br>I went with my two and a half year old daughter. We went after her doc appt which wasn&#39;t fun so I wanted to cheer her up. Not to mention, we both looked like train wrecks cause she was sick and it was a last min appt. <br>We were greeted warmly as soon as we walked in. <br>Our waiter Calvin came over immediately. He was very fast at getting food out so my daughter was occupied. He checked on us regularly. The GM came over and asked us how things went and gave us a coupon. I watched her greet all of the tables at one point or another. She even refilled my drink which wasn&#39;t even empty yet. I was impressed . <br>During the meal I had asked my daughter if she wanted a booster seat, and a random waiter overheard me and brought it over. Very thoughtful. <br><br>I had a simple soup salad and breadsticks. But they were awesome as always. The dessert was mouthwatering though. Black tie mousse cake. <br>I&#39;ve worked in the business a long time, I&#39;d be honored to have any of those people on our team! <br>Kudos Olive Garden :)",
