"reviewcomment":"The first thing you&#39;ll think when you walk in is &#34;where are all the people?&#34; which may give you the thought that this place is terrible, but it&#39;s actually quite the opposite. Prices are great and the food is delicious, Lobster Rangoons are I think $8 for 12 of them. Granted, there probably isn&#39;t even real lobster in them, but they taste good and are cooked perfectly. <br><br>Sushi/Make is great and tastes fresh, I got a platter with sashimi and the pieces were a bit too large for my liking. You almost start to think too much about the raw fish you&#39;re chewing...I like a few chews and done! <br><br>The downfall would be their service - the girl bartender makes decent drinks but you often order a drink and see her texting on her phone or disappearing for a bit before she actually makes you your drink. A young kid works with her sometimes and he is pretty awful; just isn&#39;t paying attention and ignores you, I think it&#39;s more inexperience than malicious though. <br><br>So if you want great Chinese food and Sushi and don&#39;t mind sacrificing a little service then it&#39;s awesome or just get take-out and not deal with it!",
