"reviewcomment":"I have gone to Athens 4 or 5 times now. My old supervisor from back in the 90s lives in the area also and loves this place so when he goes he sometimes calls me. I have to say...next to my mother&#39;s lamb..and she even admits this because I bought her a plate it&#39;s the best lamb shoulder I have ever tasted. It falls right off the bone. They give you huge portions also. Don&#39;t let the outside fool you...the food here tastes like home cooked. It&#39;s just outstanding food. Â Also it&#39;s nice and clean and the staff are very warm. If you want a good, old fashioned home cooked Greek meal with moussaka packed with lamb shoulder, etc this is the place. Desserts are great also. I would honestly say this could be one of the best places in Manchester. Â <br><br>One last thing...The staff is friendly but may not be the hippest when it comes to customer service. You have to give them some grace. They mean well...but it&#39;s not Copley Square Boston. They aren&#39;t rude...just old school...serve the food...get back to work types.",
