"categorystrlist":"American (Traditional),         Sports Bars",
"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/uffCrh8rN_iVl2t5-hWdAg/l.jpg",
"rating":"4.5",
"reviewcomment":"I finally decided to check out PJ&#39;s this week with a good buddy of mine. I have to admit I was a little nervous going in because of the location and such on South Willow. Not sure if I created a self fulfilling prophecy going in but when I entered to wait for my friend three guys at a table started staring at me like I was some kind of alien creature...unsettling for sure...theories: off duty cops checking out the black guy, it&#39;s bizarre for blacks to go in there, they were in a mood to beat someone up and I looked good for that..who knows but they stared at me for quite a while until my buddy came...very weird.<br><br>Service: Excellent!! Some of the best I have seen in ages for Manchester. Nicole the server was very pleasant, FUN, had a killer smile, and served us promptly. No issues what so ever. I suspect we may have gotten Nicole in trouble though for talking to her too much. Again...she was excellent.<br><br>Food: We had the fried onion rings for an appetizer and they were so good we had to fight to stop eating them...Excellent!<br>I ordered the BLT sandwich which I had a craving for and it satisfied. Very good. The tomatoes are breaded and fried though...it was great but I like raw cut tomatoes with my BLT. My buddy got the hamburger but to be honest and this rarely happens to me I was so engrossed in my own meal I didn&#39;t notice him even eating it...He finished his plate so I assumed he enjoyed it. It looked good. Fries were outstanding also. No issues there. It&#39;s standard pub food but done well with outstanding prices. I want to go back for breakfast...The menu is vast with many choices standard pub food. If you don&#39;t want to break the bank and want a decent meal it&#39;s a good choice! Â <br><br>Decor: Nice...Updated...tons of tv&#39;s...Great looking bar..Kind of a retro 70s meet modern day feel. It was cool.<br><br>.",
