"rating":"4.5",
"reviewcomment":"Everything I&#39;ve had here is top-notch. The people are warm and friendly, they care about making really tasty food for their customers. The first time I went I got fruit pancakes. When My plate came I was so surprised: Banana slices cut on the bias and strawberries cut in half cooked into these large cakes. I&#39;ll never go back to plain! His sandwiches are always made with tasty fresh ingredients, the specials are always amazing. He packs flavor and a touch of something unexpected onto every single plate. <br>Presentation is great too. I don&#39;t like to get hung up on lack of presentation, but when the food is great-tasting and the presentation is great as well, it&#39;s a bonus in my book.<br>The location is super easy to access just off Elm. After ordering at the counter, you can help yourself to coffee and flavor syrups. The seating area is warm and pretty chill. You can watch the news which isn&#39;t my preference, but it&#39;s generally pretty easy to ignore too. <br>Come on back a couple of times and you&#39;ll feel like family. My kind of place.",
