"rating":"3.0",
"reviewcomment":"I stopped by Brothers this week for lunch and had the BEST spinach pita I&#39;ve honestly ever had in my life! It was all homemade and clearly made using the freshest ingredients. The spinach was perfectly soft which the onions were still firm and had just the right slight crunch. But my favorite part was the filo dough, crispy and buttery on the outside while being soft and firm still on the inside. Firm and held together perfectly without being mushy or soggy. Amazing!<br>When I arrived the take out window was directly to my left and I could see into the kitchen. A Greek women who I realized later was the owners wife greeted me as I walked in with a friendly smile as she was busy at work. The waitress carried over that same friendly inviting welcome as she brought me to my table. I needed to charge my hot spot and asked if there was an outlet I could use. She went out of her way to plug it in for me up at the waitresses station and kept an eye on it for me. When I left she brought me my device and bill and thanked me for coming in. Oh! I almost forgot! While I was enjoying my yummy lunch the owner came over to my table personally to see if my lunch was to my liking and introduce himself. I found that to be a very nice touch. The entire experience from start to finish was EXCELLENT! They treated me like I was a regular customer that they see all the time. I can&#39;t say that was the case on this trip but they definitely will be seeing more of me on a regular basis. Fairly priced, yummy food, top notch customer service! What else could you ask for? Â  Which is why I give Brothers hands down 5 stars! <br>Thank you for a wonderful experience!",
