"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/j99kXiKT1SYqZZYer3gECQ/l.jpg",
"rating":"3.0",
"reviewcomment":"My wife and I are pretty big pizza nuts. Â We really enjoy a good pizza...of all types...New York Thin, Chicago Deep Dish...or Brick Oven style. Â While we enjoy many of the pizzerias around the area (900 Degrees, Carraba&#39;s, even Pizza Hut at times), we rediscovered Bertucci&#39;s last night.<br><br>When we first moved here 2.5 years ago, we frequented the Bertucci&#39;s in Andover, MA...but, for some reason stopped going.<br><br>Last night, I got the Carmine pizza (even though it is off the menu, it is ON their &#34;back menu&#34; and they gladly made it for me). Â The Carmine has a special roasted tomato sauce that makes it incredible. Â It is then topped with balls of fresh mozzarella and piles of deeply caramelized (not just sauteed) onions for a very unique and delicious pie.<br><br>My wife got the Pizza Verde...a relatively new creation that I dubbed the &#34;salad on a pizza crust.&#34; Â It has the same fresh mozzarella balls with prosciuotto...and then arugula piled VERY high on top...making it green looking (hence the Pizza &#34;Verde&#34;). Â To eat this, you fold a piece in half, like you would in New York, to keep the arugula on there. Â Another simply amazing variety of pizza.<br><br>Service...our waitress was quite pleasant and on the ball. Â The only issue, if there was one, was that the wait from drinks to taking order was maybe a couple minutes slow...but...absolutely nothing to complain about, I am being very nitpicky here.<br><br>Finally, the wait...if you go to this Bertucci&#39;s...and I heard people complaining about this...realize that it is (1) IN THE MALL and (2) IS VERY POPULAR...so, you will, most likely, have to wait to be seated. Â This is not the fault of the restaurant...and, frankly, is quite a good sign about the quality of the restaurant!",
