"reviewcomment":"When I&#39;m at work and hungry, this is usually the go to for their wrap selection. &#34;The Zorba&#34; and &#34;Dirty Frenchman&#34; are favorites. Delivery is usually pretty fast and of the dozens of times we&#39;ve ordered, they&#39;ve only messed something up once, and it was only forgetting a drink--they did go back and get it though.<br><br>As for the pizza...sometimes it is awesome, sometimes it is not. I have found the dough and amount of cheese they put on a pizza to be very inconsistent. One Sunday I ordered the special $5 cheese pizza, and the ratio of sauce to cheese was just NOT good.<br><br>The specialty pizzas are probably the way to go here. The signature &#34;Awesome Pizza&#34; is really good if you like a little spice. Recently, we ordered the &#34;Backyard Barbecue&#34; and were amazed! Hamburger, lettuce, onion, tomato, pickle and cheese on thousand island dressing never tasted so good! It&#39;s basically a big mac on a pizza and a small was sufficient enough to feed 3 people to the point of gut explosion.<br><br>So if you can look past the silly name, give it a try!",
