"reviewcomment":"Stopped by for a late Saturday lunch with my favorite dining companion in the world, my nine year old son. I ordered the Grace Potter grilled cheese and chili, and he had a hot dog, ugh, and a loaded baked potato soup. Please note, he despises cheese more than any other food. And yes, I brought him to a restaurant that specializes in grilled cheese. The man at the counter let him try the soup before buying luckily, and my son declared it the best soup he&#39;s ever had! (He loves to add to his &#34;best&#34; list constantly these days.) <br><br>Service was friendly and our food was brought out promptly. My sandwich was perfectly grilled, and had that yummy crispiness on the outside that you can expect from a well done grilled cheese. The fillings included Granny Smith apples, pepper relish, bacon, and a couple different cheeses and everything blended together very well. I was hoping the pepper relish would have more of a kick to it but I have a high tolerance for hot and spicy food so to the average person it may have been spicy enough. The chili was decent, typical recipe with green peppers and kidney beans and great for dunking my sandwich into. I had pasta salad on the side and it was tasty-homemade I believe. <br><br>My son&#39;s hot dog disappeared in minutes, but what else is new. He also sucked down his pickle spear and mine in no time. They were the good kind too-(the things I do for love, like giving up my pickle). He ate about half of his soup, which is great progress for a picky eater trying new things. I didn&#39;t try it, but the broth looked thin. For me, I would prefer a thicker, cream based chowder. <br><br>We both considered this a great discovery and we will definitely go again soon. There were a lot of great sounding sandwiches, and a build your own option. I was told the soups rotate too. Every since I saw the Tom and Chee episode of Shark Tank, I&#39;ve been dying for a place similar and I&#39;m happy to have found it. The prices were a little steeper than I&#39;d hoped for, but unlike the Pick 2 at Panera, you get a full sandwich with the combo. And it was very filling-I could&#39;ve taken half home and made another meal out of it....but do I ever do that? No willpower here!<br><br>Great addition to the ever growing quickservice realm of dining options out there!",
"reviewcount":"10",
