"rating":"3.5",
"reviewcomment":"I really enjoyed my Saturday night at 11Eleven Bistro. I have been to the previous restaurant Saffron Bistro with executive chef Joe Drift and enjoyed the food and service at that location. When this new restaurant opened I could not wait to try it and finally did. I started the night off with a delicious prosecco ordered the swordfish with a pineapple salsa and slaw. My table shared two appetizers. The crab cake and beef. I enjoyed the swordfish but the portion seemed small for the price. I would have liked to see some risotto on the side to add a starch. Everything was well displayed and looked presentable. The dessert was amazing! Pumpkin cheesecake and creme brule. The service was very slow and it was not a busy night. We got in right away but took a long time to order our food. The brioche before the drinks were very good too. They looked homemade and they were nice and warm. Overall the food was great but could use a little more on the plate, service was not the best but can always improve. I will sure to be back again! I miss Saffron Bistro so coming here was like being home again.",
