"rating":"4.5",
"reviewcomment":"This is a major asset for anyone interested in real Mexican food. Â I&#39;ve only scratched the surface, but I love what I&#39;ve had - the chicken and beef tacos. Â They use two soft corn tortillas to wrap the goodies in. Â There&#39;s a mixture of fine chopped lettuce and cilantro on top of the beef or chicken, and it&#39;s spiced with a subtle, but very pronounced hot spice. Â But if you&#39;re into it, make sure they include a little container of their own hot sauce - I think it&#39;s the best I&#39;ve had. Â The beef is a chipped style as is the chicken. Â Another nice touch - they also give you a little ball of tinfoil wrapped radish slices with a quarter lime. Â I&#39;m guessing you drip the lime on the radishes and eat them to cool your mouth afterwards. Â As I take the tacos home to eat, I find my superb margaritas do a much better job cooling me off!<br><br> Â I love Mexican food, and this would be a great place to call in and order food for a get together(phone #603- 305-1970). Â In this post Bush/Madoff era, when everyone is feeling the pinch, this is a great place to get terrific ethnic food at a low price and eat and drink at home for a song. Â The truck is owned by the same people who operate a similar truck on Pine Street in Nashua. Â I was talking to the woman in the Manchester truck yesterday, Virginia, and she remembered me from the Nashua truck a couple of years ago! Â I was impressed she remembered an old gringo like me.<br><br>I&#39;m no expert, but I seriously doubt you will find a better taco in the state of New Hampshire than what they serve here, for $2. Â Lake Av. and Union St. is in the heart of a tough neighborhood, but it&#39;s making a comeback, and this Taco truck is helping. Â There is also a brand new, state of the art laundromat across the street with the best washers and dryers I&#39;ve ever used. Â They do wash and fold laundry for 65 cents a pound - cheapest in the city. Â <br><br>Ole!!!",
