"rating":"3.0",
"reviewcomment":"Recently, after not wanting to wait the 40-minutes for a table at the Puritan, I happened upon Blake&#39;s once again. Â The good thing about Blake&#39;s is that you&#39;ll always find a table. Â The not so good thing is that most of the servers are teenagers and what typically comes with teenagers is not long attention spans. Â The food here is as good as the more highly overrated Red Arrow. Â I&#39;d also say that the food is more creative than The Red Arrow. Â A major plus at Blake&#39;s is that they use freshly-ground angus sirloin for their burgers which means you can get a burger cooked to your liking and not the horridly overcooked med-well that most restaurants now insist upon serving. Â They also serve plain fries. Â I don&#39;t know when this &#34;seasoned&#34; French fry trend will end but I wish it would end now. Â Blake&#39;s is also an ice cream shop so if you want to complete your diet-busting after your meal they do have a creative line up of sundaes.<br><br>All in all, if you want to avoid the lines and tight-quarters of The Red Arrow, and you enjoy diner-type food certainly do give Blake&#39;s a try.",
