"rating":"4.0",
"reviewcomment":"The 4 stars I posted for Grand Slam should be thought of as the average of 3 for the food and 4.5 for the bar. Â <br><br>The food is very, very typical Greek pizza joint stuff, just like you find in most &#34;House of ...&#34; places. Â Yes sometimes I crave it, but not very often. Â Pizza, subs, fried apps, etc. Â It is never great, but never bad. Â <br><br>Grand Slam is the closest bar to my house. Â I&#39;m not a big alcohol fan. Â I probably drink on average less than three times a month, mostly with friends over dinner (in or out). Â Once in a while I just want to go to a bar and usually one close to my house. Â I have been into the bar at Grand Slam probably 10 times over several years and I have to say that although the crowd gets younger the later it gets, I have always found the service to be excellent and the patrons to be accepting of the older (mid forties) guy and his wife - and no - my wife and I are not generally the only &#34;older&#34; people there, but we are in the minority. Â <br><br>The jukebox always provides a new experience in music for us. Â Not dance and generally not hip/hop or rap. Â Sometimes a song I recognize, old or newer, is playing. Â Most often the music playing is some new fusion of head banging rock, punk and hard rock. Â What I like is that unlike most places you can easily hear the person talking to you on the other side of the table and your waitress. Â  <br><br>The shooting (which reviewer Ryan C. brought up) I read about I think was random. Â One of the too many that happen in Manchvegas on too regular a basis. Â Maybe I should move, but so long as I don&#39;t, I won&#39;t stop enjoying Elm Street, where it seems most of these shootings happen, nor will it keep me from occasionally dropping into the bar at Grand Slam Pizza. Â I have actually come to think of it as my neighborhood bar.",
