"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/XbAo3Ld3AtLQ7sPxff7Bpw/l.jpg",
"rating":"4.0",
"reviewcomment":"UPDATE:<br><br>Since my initial posting, I&#39;ve ordered takeout a few times from Hong Kong City (HKC) during lunch hours. <br><br>SUMMARY: This Chinese takeout place is order at the counter with open kitchen and a few hard booths for eating in. The menu offerings consist of the standard Chinese American dishes including Szechuan, Hunan and Cantonese dishes, most items under $10 and house specialties $9.75-$17.50. 25 Luncheon Specials ($5.50-$6.25) served with pork fried rice or white rice, add choice of one appetizer for $1.25 more, until 3PM except Sundays &amp; Holidays. 18 All Day Dinner Specials (entree &amp; appetizers-$8.50 each) served with pork fried rice or white rice.<br><br>The portions for the Lunch Specials are very generous portion, enough for 3-4 smaller meals. I enjoy ordering the L8 Szechuan Chicken ($5.50) which consists of chopped tender boneless chicken, celery, peppers, onions, carrots, peanuts in a light spicy sauce, slightly salty taste. The pork fried rice (dark color) is made fresh which has sauteed onions and small pieces of roast pork in soft rice. The chicken teriyaki and beef teriyaki sticks are now pretty good, which have plenty of marinated tender (slightly chewy) meat with a sweet flavor. I still order the L11 Pork Lo Mein ($5.50) which has the same ingredients as my previous post with carrots, onions, vegetables, preserved mushrooms, water chestnuts and tender roast pork strips tossed in soft noodles.<br><br>Overall, Hong Kong City still offers tasty Chinese food at pretty good prices.<br><br>DELIVERY: Minimum $20 order",
