"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/qwXGaRBdy5za35oyWPfvBg/l.jpg",
"rating":"4.5",
"reviewcomment":"Stopped here with my mother after a visit to Elliot Hospital. Â I wanted something close but also something with some YELP referrals, plus I am doing my best not to eat at chain restaurants anymore.<br><br>Both my mother and I were very pleased with Pindos. Â The food was just fine, nothing fancy but satisfying, hot, and nicely presented. Â My mom had a cup of beef vegetable soup that I&#39;m sure was home made. Â Very thick and rich, lots of vegies, and steaming hot. Â And no skimping on the saltines. Â We both chose the fried chicken sandwich based on another review. Â It was indeed a simple breaded chicken patty like you would get frozen at the supermarket. Â You can&#39;t really go wrong with one of those, especially if the person frying goes light on the grease, which they did here. Â A nice fresh slice of tomato, crisp lettuce, mayo, and a very soft and fresh roll. Â This is not haute cuisine, but the sandwich was $2.50. Â Yes, $2.50! Â I ordered a side of fries, and they were delicious, very fresh and again fried just right without a lot of grease. Â I had tea, Mom had coffee, which she said was unfortunately, &#34;not the best.&#34; Â You know, the Greeks don&#39;t much like their coffee the same way Europeans like their coffee, and I hate coffee, so I&#39;ll reserve judgement on that beverage. Â Anyway, so the whole meal comes to $11. Â This is a very nice, clean place, easy to park, friendly and attentive waitress (owner?) and the bathroom was spotless. Â I can see myself going there alone quite a bit because they had a very inviting counter that snaked around the whole front room. Â You walk in the door and the place looks probably not one bit different than it did 30 years ago. Â But in a good way, like a welcome back we&#39;re glad to see you way. Â I can recommend this as a very nice little local diner.",
