"rating":"3.0",
"reviewcomment":"NOTE: The place is now Venice Old Style Pizza.<br><br>I was visiting some friends in NW Manchester in the &#34;condo ghetto&#34; near Hackett Hill. The only pizza place in the area was the &#34;Big Cheese&#34; which is no more as of last year. So Bernie &amp; Bill&#39;s on Front Street near Dunbarton Rd was the next closest pizza place to call on. According to their menu, they offer MILD or SPICY SAUCE on their pizzas, pasta dinners, and selected Italian style subs. The menu also offers salads, hot &amp; cold subs, sandwiches, gyros, wings, and appetizers. We ordered a large Sausage Pizza (14&#34;-$10.45) with spicy sauce and some 9&#34; Steak &amp; Cheese New Mexico subs ($6.75 each). The food was ready for pickup as promised in 20 minutes.<br><br>The large pizza pie (close to NY style) had a thin chewy crust with the right amount of sauce, cheese, and sausage chunks, folding the greasy slice, BUT the sauce was NOT SPICY and tasted like a typical MILD pizza sauce. Maybe they forgot, but I specifically ordered it SPICY. The pizza was still good tasting. The Steak &amp; Cheese New Mexico subs were pretty good, which had shaved steak, provolone cheese, onions, and green hot chile peppers served on a thick and chewy baked Artisan sub roll. Overall, a good little basic pizza place for delivery or takeout. Hopefully next time, we&#39;ll get some spicy sauce.<br><br>NOTE: Takeout and delivery only, no seating. The parking lot is very tight, no more than four spaces, in and out is the modus here.",
