"reviewcomment":"This little sub shop is located on Manchester&#39;s West Side. DJ&#39;s Deli &amp; Subs (owned by DJ Dave) serves up hot &amp; cold subs (8&#34;&amp;12&#34;) and wraps, sandwiches, breakfast sandwiches/subs (served anytime), salads, appetizers (wings, rings, tenders, fries, wedges, mozz sticks, bread sticks), Ms. Vickie&#39;s bagged chips and Pepsi products. Lobster rolls are offered when in season (warmer months). There is seating in front of the order counter. <br><br>I was in here this week to grab some lunch and was greeted by the owner as I was deciding what to have. I got a 12&#34; Steak &amp; Cheese Sub ($7.50 plus tax) and a Large Seasoned Fries ($3.50 plus tax) to go. The total came out to $11.88 with tax and at first I was skeptical at what I was going to get, since the price was comparable to a sit down place. A younger worker took care of my order. While I was waiting, the owner was discussing menu printing options (prices were updated recently) and advertising ideas with a sales rep, interesting part of running a small business.<br><br>Anyway, the Steak &amp; Cheese Sub was very good, which had hand sliced /grilled cube steak (no grizzle &amp; not greasy) and lots of melted cheese on a soft and chewy sub roll. The very generous amount of Seasoned Fries (crinkle cut) was fried golden brown to perfection and I really didn&#39;t need the ketchup, since the fries were done right and tasty. I ate half of the fries on the way back to the East Side office.<br><br>Definitely worth checking out if you happen to be in West Manchester!<br><br>CLOSED on MONDAYS.",
