"ogimage":"http://s3-media3.ak.yelpcdn.com/assets/2/www/img/76df14aad260/default_avatars/business_large_square.png",
"rating":"3.0",
"reviewcomment":"Shorty&#39;s Mexican Roadhouse is a very solid Tex-Mex restaurant. Â Many people are searching for &#34;authentic Mexican.&#34; Â Well, having spent a lot of time in Mexico, I am pretty sure you cannot find authentic Mexican...but you can find authentic Tex-Mex...a cuisine unto itself and quite good!<br><br>Shorty&#39;s extends the Tex-Mex a bit. Â They add BBQ pork to some of their dishes, in addition to the typical Chicken, Steak, Beef. Â This makes them a bit different, in a good way.<br><br>My wife and I have been there a few times now and have basically enjoyed it each time. Â Service has always been rock-solid, nothing super great...but there when you need them, food served fast and refills on drinks as necessary. Â One small quibble with the service...you have to ask for them to bring out chips and salsa...most Tex-Mex places just go ahead and bring them out...I am sure this is a restaurant policy and not the servers.<br><br>Food...on one visit, I tried one of their specials a Chorizo Taco (not sure of the &#34;official&#34; name). Â While definitely ok, this could have used a bit of balance in its flavors, it simply rocked the Chorizo flavor with no cooling counterbalance to make it a truly great dish. Â Another visit saw the Hawaii 5-0 Quesadilla...Chicken, Ham, Pineapple, Cheese all with the BBQ sauce. Â Very good...but excellent when some of the house salsa is added!<br><br>My wife has gotten stuck on their BBQ Pork Chimichanga. Â She loves chimi&#39;s and she loves BBQ pork...so this is right up her alley. Â This is served with the typical refried beans and rice. Â The beans are ok, sometimes a bit bland and the rice, well it is typical rice.<br><br>On our last visit...and the reason for three stars as opposed to four...they gave us a list of specials for Sept 29 - Oct 6. Â As I like to go for specials, I decided to order one of the dishes. Â When I ordered, the waitress said...&#34;oh, I do not think we have that as a special, let me check with the kitchen.&#34; Â When she came back, sure enough, they could not serve it. Â Oh, did I mention that this was on Oct 1? Â It disappointed me to have to move to something else. Â Do not offer it and then not have it!<br><br>All in all, my wife and I will be making this a regular stop...particularly when they reopen their Bedford location.",
