"reviewcomment":"La Hacienda Bakery Cafe is located at the corner of Valley and Beech Streets, underneath Don Quijote Restaurant, same ownership. This cafe and bakery offers Mexican food and some dishes off the Don Quijote menu, plus bakery goods including cookies, cakes, cheesecake, pastries, and breads. They also offer a cafeteria style buffet ($5.99 Lunch/$8.99 Dinner) which includes a choice of main entree and any three sides. The place has a few tables for dining in.<br><br>I stopped in here twice recently. On my first visit, I picked up a package of sugar cookies to snack on at work. However, the cookies were extremely hard and tough to eat. On my recent visit, I stopped in here for some lunch takeout and decided to order to try the $5.99 Buffet. I got the Beef Stew, with rice, beans, and a lettuce salad with pico de gallo, which was a good sized portion of food dished out into the styrofoam takeout container. The Beef Stew was very good with great flavors and had big chunks of Â very tender and soft slow cooked beef, carrots, potatoes in a spicy sauce. The short grain Mexican rice was decent and cooked just right. The red beans were cooked firm, not mushy.<br><br>Overall, the hot lunch I had, though not fancy, tasted pretty good and was filling! As for the baked goods, I&#39;d skip the packaged cookies next time, and get a slice of frosted cake or a danish instead.",
