"rating":"3.5",
"reviewcomment":"Abergeldie is great. Maybe it doesn&#39;t deserve 5 stars, but darn it they try so hard, like a slightly dim child who just wants a star next to their name to show their mummy, so the teacher gives it to them out of pity. Well done little Abergeldie. <br>Recently Abergeldie had an overhaul and went MEGA. It takes food orders AT your table now and has an extended restaurant type area. At heart, Abergeldie is still a chippy and serves delicious chippy food for Britain to augment its growing obesity. But Abergeldie wants to be so much more, and it would break my heart if Abergeldie didn&#39;t become a global phenomenon.<br>Abergeldie&#39;s prices are pretty standard as chippies go, but they go the extra mile with a nice(ish) homemade coffee and a woman who kissed her fingers when i ordered a jacket potato with chili as if it were some kind of beautifully selected dish.<br>You can go to Abergeldie for a nice working lunch, a lazy quick tea, or for the midnight munchies after a night on the town. Abergeldie&#39;s food will never disappoint.<br>I love you Abergeldie.",
